import React from 'react';
import './App.css';
import { Button, Container, Row, Col } from 'reactstrap';

function App() {
  return (
<Container>
    <Row>
        <Col xs="12" md="4"><Button color="danger" block>Danger</Button></Col>
        <Col xs="12" md="4"><Button color="danger" block>Danger</Button></Col>
        <Col xs="12" md="4"><Button color="danger" block>Danger</Button></Col>
        <Col xs="12" md="4"><Button color="danger" block>Danger</Button></Col>
        <Col xs="12" md="4"><Button color="danger" block>Danger</Button></Col>
        <Col xs="12" md="4"><Button color="danger" block>Danger</Button></Col>
        <Col xs="12" md="4"><Button color="danger" block>Danger</Button></Col>
        <Col xs="12" md="4"><Button color="danger" block>Danger</Button></Col>
    </Row>
</Container>
  );
}

export default App;
